import React from 'react';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';

/**import all components */
import Username from './components/Username';
import SerialNumberGeneration from './components/SerialNumberGeneration';
import Reset from './components/Reset';
import RemoveComponent from './components/RemoveComponent';
import RegisterComponent from './components/RegisterComponent';
import Register from './components/Register';
import Recovery from './components/Recovery';
import Profile from './components/Profile';
import Password from './components/Password';
import PageNotFound from './components/PageNotFound';
import Home from './components/Home';

/**root routes */
const router = createBrowserRouter([
    {
        path : '/',
        element : <Username></Username>
    },
    {
        path : '/reset',
        element : <Reset></Reset>
    },
    {
        path : '/register',
        element : <Register></Register>
    },
    {
        path : '/recovery',
        element : <Recovery></Recovery>
    },
    {
        path : '/profile',
        element : <Profile></Profile>
    },
    {
        path : '/password',
        element : <Password></Password>
    },
    {
        path : '/home',
        element : <Home></Home>
    },
    {
        path : '/register_component',
        element : <RegisterComponent></RegisterComponent>
    },
    {
        path : '/remove_component',
        element : <RemoveComponent></RemoveComponent>
    },
    {
        path : '/serialnumber_generation',
        element : <SerialNumberGeneration></SerialNumberGeneration>
    },
    {
        path : '*',
        element : <PageNotFound></PageNotFound>
    },
])
export default function App() {
    return (
        <main>
            <RouterProvider router={router}></RouterProvider>
        </main>
    )
}
